window.bookSummaryJSON = "<p><b>What’s scarier than hunting demons?</b></p> <p><b>Being bonded to one of them.</b></p> <p>Ever since I got involved with the demons, my life has fallen apart. </p> <p>Now, I’m persona non grata with the mage council. And because of me, my sister is in danger. If that wasn’t bad enough, I’m suddenly responsible for protecting two gnome kids. </p> <p>But it gets worse. I’m learning that everything I thought I knew about myself was a lie. And the underhanded demon who bonded with me? Well, he’s convinced he can keep me.</p> <p>When ancient fae artifacts start going missing, I have to use every trick up my sleeve to locate them. Someone wants to watch the world burn, and if I don’t stop them, every paranormal alive is a target. </p> <p>Armed with a power I don’t understand, and with a demon I don’t trust by my side, it’s up to me to dodge the people who want me dead and protect my city.</p> <p>Before Samael loses patience with whoever is hunting me and burns Durham down himself.</p> <p>If you like K.F Breene, Ilona Andrews, Patricia Briggs, Faith Hunter, Laurell K. Hamilton, Jennifer Estep, Shannon Mayer, Kim Harrison, and Dannika Dark, you’ll love this series. </p> <p>Listen to it now.</p>"; 
